import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <div>
            <h1>Welcome to the Energy Management System</h1>
            {/* Button to navigate to the Device List */}
            <Link to="/device-list">
                <button>View All Devices</button>
            </Link>

            {/* Button to navigate to Insert Device */}
            <Link to="/insert-device">
                <button>Insert Device</button>
            </Link>
        </div>
    );
};

export default Home;
